import React, { Component } from 'react';
import { Tabs, Tab, Grid, Cell, Card, CardTitle, CardText, CardActions, CardMenu, IconButton, Button } from 'react-mdl';


class Project extends Component {
    constructor(props) {
        super(props);
        this.state = { activeTab: 0 };
    }
    toggleCategories() {
        if (this.state.activeTab === 0) {
            return (
                <div className="projects-grid">
                    {/* Project 1 */}
                    < Card shadow={5} style={{ minWidth: '450', margin: 'auto' }}>
                        <CardTitle style={{
                            color: '#fff', height: '176px', background:
                                'url(https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRrkdjn0ilyAhSQYjyKmwab7zVv_GifzTTO_TTaXAhJyNBdCaqJ) center / cover '
                        }}>Go Project #1</CardTitle>
                        <CardText>
                            Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's
            </CardText>
                        <CardActions border>
                            <Button colored>GitHub</Button>
                            <Button colored>CodePen</Button>
                            <Button colored>Live Demo</Button>
                        </CardActions>
                        <CardMenu style={{ color: '#fff' }}>
                            <IconButton name="share" />
                        </CardMenu>
                    </Card >
                    {/*Project 2 */}
                    < Card shadow={5} style={{ minWidth: '450', margin: 'auto' }
                    }>
                        <CardTitle style={{
                            color: '#fff', height: '176px', background:
                                'url(https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRrkdjn0ilyAhSQYjyKmwab7zVv_GifzTTO_TTaXAhJyNBdCaqJ) center / cover '
                        }}>Go Project #1</CardTitle>
                        <CardText>
                            Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's
            </CardText>
                        <CardActions border>
                            <Button colored>GitHub</Button>
                            <Button colored>CodePen</Button>
                            <Button colored>Live Demo</Button>
                        </CardActions>
                        <CardMenu style={{ color: '#fff' }}>
                            <IconButton name="share" />
                        </CardMenu>
                    </Card >
                    {/*Project 3 */}
                    < Card shadow={5} style={{ minWidth: '450', margin: 'auto' }}>
                        <CardTitle style={{
                            color: '#fff', height: '176px', background:
                                'url(https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRrkdjn0ilyAhSQYjyKmwab7zVv_GifzTTO_TTaXAhJyNBdCaqJ) center / cover '
                        }}>Go Project #1</CardTitle>
                        <CardText>
                            Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's
            </CardText>
                        <CardActions border>
                            <Button colored>GitHub</Button>
                            <Button colored>CodePen</Button>
                            <Button colored>Live Demo</Button>
                        </CardActions>
                        <CardMenu style={{ color: '#fff' }}>
                            <IconButton name="share" />
                        </CardMenu>
                    </Card >
                </div>
            )
        } else if (this.state.activeTab === 1) {
            return (
                <div><h1>This is C/C++</h1></div>
            )
        } else if (this.state.activeTab === 2) {
            return (
                <div><h1>This is React</h1></div>
            )
        } else if (this.state.activeTab === 3) {
            return (
                <div><h1>This is MongoDB</h1></div>
            )
        } else if (this.state.activeTab === 4) {
            return (
                <div><h1>This is SQL Server</h1></div>
            )
        }
    }
    render() {
        return (
            <div className="category-tabs">
                          <h2>Contact Me</h2>

                <Tabs activeTab={this.state.activeTab} onChange={(tabId) => this.setState({ activeTab: tabId })} repple>
                    <Tab>Golang</Tab>
                    <Tab>C/C++</Tab>
                    <Tab>React</Tab>
                    <Tab>MongoDB</Tab>
                    <Tab>SQL Server</Tab>

                </Tabs>
                <Grid>
                    <Cell col={12}>
                        <div className="content">{this.toggleCategories()}</div>
                    </Cell>
                </Grid>
            </div>
        )
    }
}

export default Project;
